import React from 'react'
import {Icon1} from './Card_assets/Icons_1'

const Vcard = (codes) => {
  return (
    <div>
        <img src={Icon1}></img>
        <span>{codes.num}</span>
        <span>{codes.text}</span>
    </div>
  )
}

export default Vcard
